def all_paths(graph, start, end):
    result = []
    stack = [(start, [start])]

    while stack:
        node, path = stack.pop()

        for neighbor in graph[node]:
            if neighbor == end:
                result.append(path + [neighbor])
            else:
                stack.append((neighbor, path + [neighbor]))

    return result

# Example usage
graph = {0: [1, 2], 1: [2], 2: [3], 3: [4], 4: []}
source = 0
target = 4
print(all_paths(graph, source, target))
